    false,nt"url": null,nt"notes": "The Mark Twain National Wildlife Refuge
    Water Management Plan aims to develop a practical schedule for water management
    on the Calhoun, Batchtown and Gilbert Lake Divisions of the Brussels District of
    the Mark Twain National Wildlife Refuge for 1994. This plan, the Five Year Water
    Management Plan, current funding and prevailing environmental conditions will serve
    as the basis for management decisions. Part I discusses the 1993 water management
    activities and information on the refuge, including units, pools, and divisions.
    Part II focus on the management objectives for the coming year.",nt"owner_org":
